import './App.css';

function App() {
  //js codes
  let header="title"
  let url="https://github.com/"
  let img="https://centralalabamascoreboard.com/wp-content/uploads/2021/10/IMG-vs-AUburn.jpg"
  return (
    <div className="App">
      <img height="50%" width="50%" src={img} alt="" />
      <a href={url}>Link</a>
      <h1>{header} </h1>
      <h1>{header} </h1>
      <h1>{header} </h1>
      <h1>{header} </h1>  
      <p>{header}</p>
    </div>
  );
}

export default App;
